// frontend/src/components/ContactComponent.js
import React from 'react';

const ContactComponent = () => {
  return (
    <div>
      <h2>Contact Us</h2>
      <p>If you need help, please contact support@example.com</p>
    </div>
  );
};

export default ContactComponent;
